import React,{useState} from 'react';
import classes from './App.module.css';
import Maze from './Components/MazeComponents/Maze';
import EditMenu from './Components/MazeComponents/EditMenu';

function App() {
  let dim = [25,25];
  const [wallControl, setWallControl] = useState(false);

  const changeWallControl = (status) => {
    setWallControl(status);
  };

  return (
    <>
      <div className={classes.heading}>
        Maze Solver
      </div>
      <EditMenu className={classes.['menu']} wallControlOn={changeWallControl}/>
      <Maze 
       className={classes.body} dim={dim} wallControlStatus={wallControl}/>
    </>
  );
}

export default App;
